package pAYILAGAM;

public class AscendingOrder {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
for(int i=0;i<=0;i++)
{
	for(int j=1;j>i;j--)
	{
		System.out.print("1\n");
		System.out.println("22");
	}
	
	for(int k=1;k>i;k--)
	{
		System.out.print("333\n");
		System.out.println("4444");
	
	}System.out.println();
	
}}}
